import React, { Component } from 'react';
import ButtonTrend from './ButtonTrend.js'
import styles from './ButtonTrend.module.css';

class App extends Component {
  constructor(props) {
    super(props);
  }

  render(props) {
    return (
      <div className="Container">
        <ButtonTrend {...props} />
      </div>
    );
  }
}

export default App;
